import React from "react";
import { useNavigate } from "react-router-dom";

const Profile = () => {
  const navigate = useNavigate();

  const handler = () => {
    navigate("/home");
  };

  return (
    <div
      style={{
        backgrocolor: "red",
        // height: "100vh",
        // backgroundSize: "cover",
        // backgroundRepeat: "no-repeat",
        // backgroundPosition: "center",
        // display: "flex",
        // alignItems: "center",
        // justifyContent: "center",
        // position: "relative",
      }}
    >
      <div
        style={{
          padding: "100px",
          position: "absolute",
          top: "0",
          left: "0",
          right: "0",
          bottom: "0",
          backgroundColor: "rgba(0, 0, 0, 0.5)",
          color: "white",
          display: "flex",
          textAlign: "center",
          justifyContent: "center",
          zIndex: "1",
        }}
      >
        <h1>Welcome!</h1>
      </div>
    </div>
  );
};

export default Profile;
